import { describe } from 'react-desc';
export var doc = function doc(CardFooter) {
  var DocumentedAccordionPanel = describe(CardFooter).description("The Card Footer. Works best as the latter sibling of CardBody or any \n      other flex container.").intrinsicElement('div');
  return DocumentedAccordionPanel;
};
